#region 常量定义区
#A文件的气象要素标识符，一个字符表示一个气象要素
OBstrs='PTIEUNHCVRWLZGFDKASB'
#region 用base64存储excel模板文件，直接在代码中调用，减少模板文件被修改的可能。
import base64
from io import BytesIO 
#region base64 excel模板文件   
